"use client";

import { Lora } from "next/font/google";
import Image from "next/image";
import React from "react";
import CTA from "../CTA";

const lora = Lora({
  subsets: ["latin"],
  weight: ["400", "500", "600", "700"],
});
const JoinOurTeam = () => {
  return (
    <section className="min-h-[460px] md:min-h-[680px] overflow-x-hidden">
      <div className="relative pt-10 flex flex-col justify-center text-center">
       <h1 className="text-3xl md:text-5xl font-normal leading-snug font-lora">
             Be Part of  <span className="text-primary">Relevant</span> In
              The <span className="text-primary">Market</span>.
            </h1>
        <Image
          src="/images/home/join_our_team.webp"
          alt="join_our_team"
          width={1000}
          height={600}
          className="object-cover scale-[130%] md:scale-150 -mt-14  p-10 sm:pe-24 md:pe-0"
        />
        <div className="absolute bottom-[5%] right-8 md:bottom-[3%] md:right-24 z-20 ">
          <CTA url="#" label="Join Our Team" />
        </div>
      </div>
    </section>
  );
};

export default JoinOurTeam;
